You may have noticed that the button used above doesn't do anything. Lets fix that. If you look at the TextButton docs, you'll notice that it has an on_push method, allowing a closure to be set as a "push" event handler. This closure must have the following type: F: Fn(&mut Manager<'_>) -> Option<M> + 'static In other words, it takes a reference to the Manager and returns an optional message of type M. We'll come back to messages later; for now we can just return None — well, we could if type inference worked, but since None could be an option of any type we have to specify that we want VoidMsg: let content = TextButton::new("Push me").on_push::<VoidMsg, _>(|_| { println!("Hello!"); None
}); But let's not just print to the command-line: lets use the Manager to open a message dialog! let content = TextButton::new("&Push me").on_push::<VoidMsg, _>(|mgr| { let mbox = MessageBox::new("Message", "You pushed the button."); mgr.add_window(Box::new(mbox)); None
}); One final note: did you see we put an ampersand in "&Push me"? Try holding Alt and pressing P when you run the example: cargo run --example hello-handler

