To make a counter, we need two widgets: a button and a label. Lets solve the layout part first, using make_widget (although this isn't the only way to do layout). use kas::event::VoidMsg;
use kas::macros::make_widget;
use kas::widget::{Label, TextButton, Window}; fn main() -> Result<(), kas_wgpu::Error> { env_logger::init(); let content = make_widget! { #[layout(column)] #[handler(msg = VoidMsg)] struct { #[widget(halign = centre)] display = Label::new("0".to_string()), #[widget] _ = TextButton::new("&count"), counter: u32 = 0, } }; let window = Window::new("Counter", content); let theme = kas_theme::ShadedTheme::new(); kas_wgpu::Toolkit::new(theme)?.with(window)?.run()
}

